import './MenuPage.css'
import '../App.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Card, Collapse } from 'react-bootstrap';
import { useEffect, useState } from 'react';

function MenuPage(props) {
  const [open, setOpen] = useState(false);

  console.log(props.locationMenu)

  const ItemCard = ({ item }) => {
    return (
      <Card onClick={() => setOpen(!open)} aria-controls="item-info" aria-expanded={open}>
        <Card.Title>{item.name}</Card.Title>
        <Collapse in={open} appear={true}>
          <Card.Text id="item-info">gggg</Card.Text>
        </Collapse>
      </Card>
    )
  }

  return (
    <>
      <div className="flex-top-left">
        <Button variant="primary-light" onClick={props.return}>Back</Button>
      </div>
      <p className="fs-1 title">{props.menuName}</p>
      {props.locationMenu.Breakfast.map((item) => 
        <ItemCard key={item.name} item={item}/>
      )}
    </>
  );
}

export default MenuPage;
